import { useState } from 'react'
import Shelter from '../../desingImgs/shelter.jpg'
import { Img, Container } from './desingsStyles'

const Designs = () => {
    const [photos, setPhotos] = useState([Shelter, Shelter])
    return (
        <Container>
            {
                photos && photos.map(p => (
                    <Img src={p} />
                ))
            }
        </Container>
    )
}

export default Designs
